import React from 'react'
import {NavLink} from 'react-router-dom'

function Nav() {

  return (
    <div className='nav-container'>
        <ul className='nav-list'>
            <NavLink to='/'><li className='nav-item' ><button>Home</button></li></NavLink>
            <NavLink to='/new'><li className='nav-item' ><button>New</button></li></NavLink>
        </ul>
    </div>
  )
}

export default Nav
